import * as React from "react";
import gql from "graphql-tag";
import { useLazyQuery } from "@apollo/react-hooks";
// Style
import './UserCompanies.styl'; 

// GraphQL
const COMPANIES_BY_USER = gql`
  query getCompaniesByLoggedUser($PopulateInput:PopulateInput!) {
    getCompaniesByLoggedUser(PopulateInput:$PopulateInput) {
      _id
      avatar
      language
      name
      url
    }
  }
`;

//
// Function
//

const UserCompanies: React.FunctionComponent<{}> = () => {
  // Set States
  const [activeCompanyId, setActiveCompanyId] = React.useState(null);
  // GraphQL - Q's
  const [ getCompanies, 
    { 
      loading:companiesLoading, 
      data:companiesData, 
      error:companiesError 
    }
  ] = useLazyQuery(COMPANIES_BY_USER, { 
    fetchPolicy: "no-cache",
    errorPolicy: "all" 
  });

  //
  // Use Effect
  //

  React.useEffect(() => {
    // Get Companies
    if(!companiesData) {
      getCompanies({ variables: {  
        PopulateInput: {
          key: "_owner",
          skip: 0,
          limit: 10
        }
      }});
    } else {
      // Set Active Company ID
      setActiveCompanyId(companiesData.getCompaniesByLoggedUser[0]._id)
    }
  },[activeCompanyId, setActiveCompanyId, companiesData]);

  // Return
  return (
    <>
      <div className="companies-list">
        {companiesLoading && <p>Loading...</p>}
        {companiesError && <p>Error :( Please try again</p>}
        {companiesData && 
            <>
            {companiesData.getCompaniesByLoggedUser.length === 0 && <>No Companies</>}        
            {companiesData.getCompaniesByLoggedUser.map((value, index) => {
                return( 
                <div className="list-company-item" key={index}>
                    <div className="item-company-avatar">
                        <div className="avatar-image"></div>
                    </div>
                    <div className="item-name">{value.name}</div>
                    <div className="item-url">{value.url}</div>
                </div>
                )
            })}
            </>
        } 
      </div>  
    </>
  );
};

export default UserCompanies
